import React from "react";
import {MenuList, MenuItem, } from '@material-ui/core'

export default function SideBar(props) {
  return (
    <div>
      <MenuList className={classes.sideBarMenu}>
        <MenuItem>
          <SendIcon />
        </MenuItem>
        <MenuItem>
          <PriorityHighIcon />
        </MenuItem>
        <MenuItem>
          <DraftsIcon />
        </MenuItem>
      </MenuList>
    </div>
  );
}
